import React from 'react';
import logo from './logo.svg';
import './Design.css';

function Design() {
  return (
    <div className="App">
      <div class="starter-template">
        <img id="headshot" src="images/github.jpg" alt="Mountain View"/>
        <h1>Cian O Mahony</h1>
        <p class="lead">University College Cork</p>
        <a href="/coding"><button type="button" className="btn btn-primary btn-coding">Coding</button></a>
        <a href="/design"><button type="button" href="/design" className="btn btn-primary btn-design">Design</button></a>
        <a href="images/cvtech.pdf"><button type="button" href="images/cvtech" className="btn btn-primary btn-cv">CV</button></a>
      </div>
    </div>


  );
}

export default Design;
